sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
var funds=[];
var responseFunds=(inputs.fundReq);
if(responseFunds.length>0){
    responseFunds=JSON.parse(responseFunds);
if(responseFunds &&responseFunds.length>0){   
    responseFunds.forEach(function(fund){
        var fundObject={
            "pcntgalloctn":fund.percent,
            "fundnm":fund.name_cd
        }
        funds.push(fundObject);
    });
    outputs.fund=JSON.stringify(funds) || [];
}
}
else{
    outputs.fund= [];

}

})(inputs, outputs);

